import React from "react";
import {
  Text,
  Container,
  Body,
  Content,
  Header,
  Title,
  Left,
  Button,
  Right,
  Icon
} from "native-base";
import { useNavigation } from "@react-navigation/native";
const PropertyDetail: React.FC<{}> = () => {

  const navigator = useNavigation();

  return (
    <Container>
      <Header noShadow>
        <Left>
          <Button transparent iconLeft onPress={() => navigator.goBack()}><Icon name="md-arrow-back" style={{ color: "#ef6235" }}></Icon></Button>
        </Left>
        <Body>
          <Title>Sobre</Title>
        </Body>
        <Right></Right>
      </Header>
      <Content padder>
        <Text>Ol√° mundo</Text>
      </Content>
    </Container>
  )
}

export default PropertyDetail;
